import React from 'react';
import {Row, Col, Container} from 'react-bootstrap';
import './sidebar.css';
//import '../../custom.scss';

function Example() {
  return (
        <Container fluid>
                <Col className="sidebar">
                Bava
                </Col>
                <Col className="sidebar">
                Bava
                </Col>
            
        </Container>
    )
}

export default Example;
